import { createIcon } from "../icon/createIcon";

export const MoveAllIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="MoveAllIcon">
    <path d="M5.25 7h1.5v2.001L9 9l-3 3-3-3 2.25.001V7zM3 3l-.001 2.25H5v1.5H2.999L3 9 0 6l3-3zm6 0 3 3-3 3V6.75H7v-1.5h2V3zM6 0l3 3H6.75v2h-1.5V3H3l3-3z" />
  </svg>,
  "MoveAll",
  "move all"
);
